#### Definitions

**1**   In this Act:

**"child"** includes a person to whom a member has demonstrated a settled intention to treat as a child of his or her family;

**"commissioner"** means the person appointed under section 14;

**"member"** means a member of the Legislative Assembly or of the Executive Council, or both;

**"private corporation"** means a corporation, all of whose issued and outstanding securities are subject to restrictions on transfer and are beneficially owned directly or indirectly by not more than 50 persons;

**"private interest"** does not include an interest arising from the exercise of an official power or the performance of an official duty or function that

(a) applies to the general public,

(b) affects a member as one of a broad class of electors, or

(c) concerns the remuneration and benefits of a member or an officer or employee of the Legislative Assembly;

**"spouse"** means a person who is married to a member or a person who is living with a member in a marriage-like relationship, but does not include a person who is separated and living apart from a member and who

(a) has entered into a written agreement under which they have agreed to live apart, or

(b) is subject to an order of the court recognizing the separation.

#### Power to enforce summons and punish for contempt

**21.1**   (1) The commissioner may make an order finding a person to be in contempt, and may impose a fine on or commit the person for contempt, if the person has been served with a summons under section 21 and fails or refuses to do any of the following:

(a) attend before the commissioner;

(b) take an oath or make an affirmation;

(c) answer questions;

(d) produce records or things in the person's possession or control.

(2) The commissioner may call on the assistance of any peace officer to enforce an order made under this section, and, if called on, the peace officer may take any action that is necessary to enforce the order and may use such force as is reasonably required for that purpose.
